const { height, width } = Dimensions.get("screen");
const Welcome = () => {
    return (
        <View style={styles.container}>
        <ImageBackground source={bg}>
        
        </ImageBackground>
        </View>
    );
}


export default Welcome;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      height,
     
    },
    background: {
      height: '100%',
      width: '100%'
    },
   
    
  });
